                </div>

                <div className="form-outline form-white mb-4">
                  <input type="password" 
                        id="typePasswordX" 
                        onChange={(e)=>setPwd(e.target.value)}
                        value={pwd}
                        required
                        className="form-control form-control-lg" placeholder="Password" 
                        />
                  <label className="form-label" htmlFor="typePasswordX">Password</label>
                </div>

